import React from "react";
import axios from "axios";
import {Form} from 'reactstrap';

function HandleSubmit (props) {
    axios.delete(`/api/tasks/, ${props.id}`)

    .then((response) => {
        console.log(response);
        console.log(props.id)
      }, (error) => {
        console.log(error);

    })
}

const DeleteTask = () => {
    return(
        <Form>
             <button className="btn btn-dark" onSubmit={this.HandleSubmit}>
                Delete Task
            </button>
        </Form>


    )
}

export default DeleteTask;
